import { ProTable } from '@ant-design/pro-table';

function Student() {
  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Age',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
  ];

  const tableProps = {
    columns,
    request: async (params) => {
      // Get the search query from the params object
      const { keyword } = params;
      // Make an API call to fetch the filtered data
      const response = await fetch(`/api/data?keyword=${keyword}`);
      const data = await response.json();
      return { data };
    },
  };

  return <ProTable {...tableProps} />;
}
export default s
